import EventsList from '../components/EventsList';

const EVENTS = [
  {
    id: 'e1',
    title: 'Event 1',
    date: '2018-01-01',
    imageUrl: 'data:image/jpeg;base64,',
  },
  {
    id: 'e2',
    title: 'Event 2',
    date: '2018-01-02',
    imageUrl: 'data:image/jpeg;base64,',
  },
  {
    id: 'e3',
    title: 'Event 3',
    date: '2018-01-03',
    imageUrl: 'data:image/jpeg;base64,',
  },
];

const EventsPage = () => {
  return <EventsList events={EVENTS} />;
};

export default EventsPage;
